import { Container, Row, Col } from "shards-react";
import Heading from "./components/Heading/Heading.js";
import Daily from "./components/Daily/Daily.js";
import BobaTracker from "./components/BobaTracker/BobaTracker.js";

import "bootstrap/dist/css/bootstrap.min.css";
import "shards-ui/dist/css/shards.min.css";
import "./App.css";

function App() {
  return (
    <Container
      fluid
      className="wrapper border justify-content-center align-items-center"
    >
      {/* HEADING */}
      <Row>
        <Col sm="12" md="6" lg="9" className="block">
          <Heading />
        </Col>
      </Row>
      {/* DAILY */}
      <Row>
        <Col sm="12" md="6" lg="8" className="blue block">
          <Daily />
        </Col>
      </Row>
      {/* FINANCIALS */}
      <Row className="green block"></Row>
      {/* COFFEE */}
      <Row className="pink block"></Row>
      {/* BOBA */}
      <Row className="brown block"></Row>
    </Container>
  );
}

export default App;
